// import React from "react";
import React, {useState, useEffect} from "react";
// import '../../src/estilos/componentes/paginas/inicio.css'
import '../../src/App.css'


const Inicio = (props) => {
    const [cartaDePresentacion, setCartaDePresentacion] = useState('');
    useEffect(() => {
        const datosCarta = "Mi nombre es Pablo Iván Bárcena y tengo 39 años...";
        setCartaDePresentacion(datosCarta);
    }, []);
    return (
        <section className="Inicio">
        <h3>Inicio</h3>
        <div className="seccionConBordes">
            <h4>Carta de presentacion</h4>
            <div className="Carta" id="unaCarta">
            <p>{cartaDePresentacion}</p>
            </div>
        </div>
        <div className="seccionConBordes">
            <h4>Portafolios web</h4>  
            <div className="Portafolios contTarjetas" id="unPortafolios">
            </div>
        </div>
    </section>
    );
}

export default Inicio;
